import React, { useEffect, useState } from "react";
import axios from "../Axios";
function EmployeeAttendance({ attendance }) {
  return (
    <div>
      <h2>Attendance</h2>
      <h4>Total Attendance : {attendance.length}</h4>
      {attendance.map((att) => {
        const { date, attendance } = att;
        return (
          <div>
            <div className="att-row">
              <span>date : {date}</span> <span>:</span>
              <span> attendance : {attendance}</span>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default EmployeeAttendance;
